import jsonData from '../../json/database.json';

export const getData = () => {
  return jsonData.test ? jsonData.test : [];
};

export const updateData = (id, newData) => {
  jsonData.test[id] = { ...jsonData.test[id], ...newData };
  return jsonData.test;
};
